import React from 'react';
import Navigation from '../components/Navigation';
import Logos from '../components/Logos';
import Coutries from '../components/Coutries';

const Home = () => {
    return (
        <div>
            <Logos/>
            <Navigation/>
            <Coutries />
        </div>
    );
};

export default Home;
